	add("megalopoleis", "{\"term\":\"megalopoleis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1945\u0027\u0027: University of Arizona, \u0027The Arizona Quarterly\u0027, p1\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Beautiful, thriving cities were now seen as soulless \u0027\u0027megalopoleis\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1963\u0027\u0027: Duncker and Humblot, \u0027Sociologia Internationalis: “The Greeks had a Word for it”\u0027, p17\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Megalopolis\u0027\u0026lt;sup\u0026gt;3\u0026lt;/sup\u0026gt; (pl. \u0027\u0027\u0027Megalopoleis\u0027\u0027\u0027) was labelled “obsolete” in major English-language dictionaries of less than half a century ago\u0026lt;sup\u0026gt;4\u0026lt;/sup\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027: Daniel U. Levine, \u0027Education in Metropolitan Areas\u0027, p4\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Other \u0027\u0027megalopoleis\u0027\u0027, not yet so large, extend from San Jose through the San Francisco Bay Area to Richmond and Marin County; from San Diego through Los Angeles to Bakersfield; from Milwaukee through Chicago, Gary, South Bend, across southern Michigan to Detroit\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027: Gocha R. Tsetskhladze, \u0027Ancient West and East\u0027, p39\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"On the other hand, large \u0027\u0027megalopoleis\u0027\u0027, such as imperial Constantinople or Rome which drew on resources from broad sections of the Mediterranean, cannot easily be reduced to an expression of the same fundamental ecological mechanism that the authors see governing the majority of infinitely smaller settlements\", \"priority\":8}]}, \"synonyms\":{}}");

