	add("megapenny", "{\"term\":\"megapenny\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"ancient greek (to 1453)\"], \"text\":\"* mega-, from Ancient greek (to 1453) μεγα- (\u0027megas\u0027), + penny, from Old english (ca. 450-1100) \u0027penning\u0027 or \u0027pennig\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A million cents. ($10,000\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997,\u0027\u0027 Gene Wirchenko, \u0027[http://groups.google.com.au/group/alt.folklore.computers/browse_thread/thread/a2e2ec540fc3d96f/b602eb83533143f9?lnk\u003dst\u0026amp;hl\u003de\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"b602eb83533143f9 Re: New IEC proposal: 1 kibibyte \u003d 1024 bytes]\u0027, alt.folklore.computers (January 10, 1997\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Or megapenny ($10,000) and nanoacre (for measuring chip sizes\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2005,\u0027\u0027 \u0027holatuwol\u0027, \u0027[http://forums.kingdomofloathing.com/viewtopic.php?p\u003d541750 Forum post]\u0027, forums.kingdomofloathing.com (February 19, 2005\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"If I could, there would probably be dozens of large software corporations banging on my door, offering 20 megapennies a year, company cars\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An indefinite amount of money, implied to be large\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1992,\u0027\u0027 \u0027Stinger51\u0027, \u0027[http://www.phpbuilder.com/board/showthread.php?t\u003d10210023 IE vs. NS (philosophy question)]\u0027, phpbuilder.com (October 11, 2002\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A megapenny for your thoughts, please\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1998,\u0027\u0027 Greg Bennett and David C. Cox, \u0027[http://www.web.net/~ondp/nod/feb98/topten.htm Top Ten Harris Lies]\u0027, \u0026quot;Harrisment\u0026quot; (February 1998\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Not a penny, but megapennies\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2004,\u0027\u0027 \u0027holatuwol\u0027, \u0027[http://www.moonromance.net/portal_postview.php?fid\u003d19\u0026amp;pid\u003d1428750 Re: What is causing this phenomena?]\u0027, \u0026quot;MoonRomance\u0026quot; (June 10, 2004\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"without resorting to shelling out megapennies\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2005,\u0027\u0027 Phil Hampton, \u0027[http://web.archive.org/20051224203135/dilbertblog.typepad.com/the_dilbert_blog/2005/12/billionaires_mo.html re: Billionaire’s Money Question]\u0027, Dilbert Blog (December 20, 2005\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"And any billionaire who\u0027s worried about losing that megapenny really ought to take up a hobby, like maybe horse riding\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"2006,\u0027\u0027 mbhunter, \u0027[http://www.mightybargainhunter.com/2006/08/20/ten-unconventional-uses-for-the-penny/ Ten unconventional uses for the penny]\u0027, Mighty Bargain Hunter (August 20, 2006\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"No. 7: .... Settle out of court for many, many megapennies\", \"priority\":17}]}, \"synonyms\":{}}");

