	add("megaron", "{\"term\":\"megaron\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027μέγαρον\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The rectangular great hall in a Mycenaean building, usually supported with pillars\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, w:Keith Keith DeVries (editor), Machteld J. Mellink, \u0027VII. Archaic Wall Paintings from Gordion\u0027, \u0027From Athens to Gordion: The Papers of a Memorial Symposium for Rodney S. Young\u0027, %22megarons%22|%22megara%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dLStJ6HVJVZ\u0026amp;sig\u003dvtREJNu-vctF4EJpJxzhTO8-VvY\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003daVFtUP3oLYaciAej84DwCA\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22megarons%22|%22megara%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 91\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027megara\u0027\u0027 faced north (“notebook north” equals true northeast) in the first court behind the archaic East Gate, similar in layout to their predecessors \u0027\u0027Megara\u0027\u0027 1 and 2 in the pre-Kimmerian East Court. \u0027\u0027Megaron\u0027\u0027 C had gone through a period of use and a complete reconstruction before the Painted House was built\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, G. R. H. Wright, \u0027Ancient Building in South Syria and Palestine\u0027, %22megarons%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dgPN8i_cY4p\u0026amp;sig\u003doaO1DquxkP-TPN-PDEvaDKx82Kk\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dH05tUKvGFu-fiAfEl4HoCg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"%22megarons%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 141\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027megaron\u0027\u0027 is a hall building with an open-fronted porch, but this porch is not just any laterally confined space\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, H. Gönül, \u0027Main topics and discussions on ancient Greek Architecture on West Anatolia\u0027, C. A. Brebbia, L. Binda (editors), \u0027Structural Studies, Repairs and Maintenance of Heritage Architecture XII\u0027, WIT Press, [http://books.google.com.au/books?id\u003dK17a6qIguZkC\u0026amp;pg\u003dPA64\u0026amp;lpg\u003dPA64\u0026amp;dq\u003d%22Probably+he+points+out+that+the+east+room,+used+as+oikos%22\u0026amp;source\u003dbl\u0026amp;ots\u003dTgWU4eX4ZB\u0026amp;sig\u003dgBzqGGY7yWzPEImVS-YfJa5KJWc\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d0FhtUP2KJaSaiQe2p4Fg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Probably%20he%20points%20out%20that%20the%20east%20room%2C%20used%20as%20oikos%22\u0026amp;f\u003dfalse page 64\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Probably he points out that the east room, used as oikos, is wider and shorter than the classical narrow and long \u0027\u0027megaron\u0027\u0027 form. Although this house is interpreted as two \u0027\u0027megarons\u0027\u0027 side by side, Akurgal [4] also states that the east wall of the space XIV is added later to the building, which means that the east part is not a \u0027\u0027megaron\u0027\u0027, but a rectangular room at the first construction phase\", \"priority\":10}]}, \"synonyms\":{}}");

